import{_ as e,o as t,a as r,X as o}from"./chunks/framework.BPPv2K3c.js";const b=JSON.parse('{"title":"2019年を振り返って","description":"","frontmatter":{"layout":"post","title":"2019年を振り返って","category":"diary","tags":["diary"],"head":[["link",{"rel":"canonical","href":"https://www.codingfeline.com/2019/12/31/lookingback-2019/"}],["meta",{"property":"og:url","content":"https://www.codingfeline.com/2019/12/31/lookingback-2019/"}],["meta",{"property":"og:title","content":"2019年を振り返って"}],["meta",{"property":"twitter:card","content":"summary_large_image"}],["meta",{"property":"twitter:site","content":"@_yshrsmz"}],["meta",{"property":"twitter:creator","content":"@_yshrsmz"}],["meta",{"property":"og:image","content":"https://www.codingfeline.com/2019/12/31/lookingback-2019/ogp.png"}]]},"headers":[],"relativePath":"2019/12/31/lookingback-2019/index.md","filePath":"posts/2019/2019-12-31-lookingback-2019.md","date":{"time":"2019-12-31","string":"December 31, 2019","year":"2019","month":"12","day":"31"}}'),i={name:"2019/12/31/lookingback-2019/index.md"};function n(l,a,h,s,d,c){return t(),r("div",null,[...a[0]||(a[0]=[o('<p>2019年を振り返るよ。</p><h2 id="仕事" tabindex="-1">仕事 <a class="header-anchor" href="#仕事" aria-label="Permalink to &quot;仕事&quot;">​</a></h2><p>Kotlin Multiplatform ProjectでAndroidとiOSのモバイルアプリを作っています。新規のプロジェクトで、ようやくリリースできそうな気配。<br> KMP、いろいろ考えることはあるけれどなかなかうまいこと回せている気がする。<br> うちのチームではプレゼンテーション層からKMPで共通化しているんだけど、自分がAndroidの画面を作ってるうちにiOSの人が新規のViewModelを作っていて、すぐに新しい画面に取りかかれる、というのはなかなか素敵な経験だった。</p><h2 id="個人" tabindex="-1">個人 <a class="header-anchor" href="#個人" aria-label="Permalink to &quot;個人&quot;">​</a></h2><p>今年は結局Flutterでアプリ出せなかったのが心残り。<br> やはり本業がある程度楽しいと個人開発まで手が回らないなあ、という印象。<br> いくつかライブラリは公開できたけど、これはまあ仕事の延長みたいなところはある。</p><h3 id="tabs2links" tabindex="-1"><a href="https://chrome.google.com/webstore/detail/tabs2links/hlmnkbgbionilbjkgmghmdeokakmojmi" target="_blank" rel="noreferrer">Tabs2Links</a> <a class="header-anchor" href="#tabs2links" aria-label="Permalink to &quot;[Tabs2Links](https://chrome.google.com/webstore/detail/tabs2links/hlmnkbgbionilbjkgmghmdeokakmojmi)&quot;">​</a></h3><p>ブログ書くときに参考サイトのリンクをまとめるのが手間だったので作ったChrome拡張機能。紹介記事は<a href="/2019/03/20/chrome-extension-tabs2links/">こちら</a>。</p><h3 id="buildkonfig" tabindex="-1"><a href="https://github.com/yshrsmz/BuidKonfig" target="_blank" rel="noreferrer">BuildKonfig</a> <a class="header-anchor" href="#buildkonfig" aria-label="Permalink to &quot;[BuildKonfig](https://github.com/yshrsmz/BuidKonfig)&quot;">​</a></h3><p>Kotlin Multiplatform ProjectでAndroidのBuildConfigに相当する、APIキーとか埋め込む機能が欲しくて作ったGradle Plugin。<br> 幸い同じようなニーズを持っている人は多かったらしく、そこそこ使ってもらえてるみたい。<br> 紹介記事は<a href="/2019/02/27/buildkonfig-kotlin-mpp/">こちら</a>。<br> この記事書いたときからちょっと変わってて、共通の定数しかないときは普通のobjectを生成するようになってたり、あと近いうちにnullableがサポートされる予定。</p><h3 id="kgql" tabindex="-1"><a href="https://github.com/yshrsmz/kgql" target="_blank" rel="noreferrer">kgql</a> <a class="header-anchor" href="#kgql" aria-label="Permalink to &quot;[kgql](https://github.com/yshrsmz/kgql)&quot;">​</a></h3><p>GraphQLのドキュメントから、kotlinx.serializationでいい感じにJSONにパースできるコードを生成するGradle Plugin。 紹介記事は<a href="/2019/02/27/kgql-graphql-kotlin-mpp/">こちら</a>。</p><h3 id="androiddagashi" tabindex="-1"><a href="https://androiddagashi.github.io" target="_blank" rel="noreferrer">AndroidDagashi</a> <a class="header-anchor" href="#androiddagashi" aria-label="Permalink to &quot;[AndroidDagashi](https://androiddagashi.github.io)&quot;">​</a></h3><p>おかげさまで100回を迎えることできた。新しくメンバーも迎えて、2020年も粛々とやっていく。<br> 技術的な点で行くとデプロイ周りのジョブをCircleCIからGitHub Actionsに移行したり、あとはツイートを自動化したりとかやった。</p><h3 id="デス・ストランディング" tabindex="-1">デス・ストランディング <a class="header-anchor" href="#デス・ストランディング" aria-label="Permalink to &quot;デス・ストランディング&quot;">​</a></h3><p>これ何気に小島監督作品初プレイだった。荷物運ぶだけなのにこんなに面白くできるんだなあ、と。<br> アクション要素もあるけどほどほどで、わりとゆるーくできてよかった。</p><h3 id="ミニチュアペイント" tabindex="-1">ミニチュアペイント <a class="header-anchor" href="#ミニチュアペイント" aria-label="Permalink to &quot;ミニチュアペイント&quot;">​</a></h3><img src="https://lh3.googleusercontent.com/pw/ACtC-3eTymvIRBCRr7JcrwrQGOg5agEF6nrnCYL591tD5-6eFmvllJTW3Hkk97rYxRixsFhsyUGCeHWbt6a7dHINQNvwmBJq2KccCi_lKpQiVZYPjpWaW1WccQOIdCqClCQhhWKKxlzI2wgJgICojuSEShcNKQ=w560"><p>ふと思い立ってミニチュアペイントを始めてみた。<br> 最初はウォーハンマーをいくつか塗って、その後もっとかわいいのが塗りたくなってKingdomDeathに手を出した。<br> ちまちま塗るのなかなか楽しくて、立体塗り絵って感じ。シタデルカラーはもうシステムが出来上がっているので調色で戸惑うことも殆どなくてよい。<br> 気がついたら塗装ブースが増えてたりエアコンプレッサー(TWIN CUBE)が増えてたり、結構な沼です。2020年もゆるゆる浸かっていこうと思う。</p><h2 id="_2020年の目標" tabindex="-1">2020年の目標 <a class="header-anchor" href="#_2020年の目標" aria-label="Permalink to &quot;2020年の目標&quot;">​</a></h2><p>個人でメンテしてるアプリ/サービスが多くなってくるとそっちのメンテの時間も捻出しなきゃでアレ。 今年はAndroid版OmnitweetyとMonotweetyをまとめてしまおうかと計画中。<br> あと我が家のペット関連で作りたいアプリがあるのでそれも形にしたい。</p>',20)])])}const m=e(i,[["render",n]]);export{b as __pageData,m as default};
